import React from "react";
import "./App.css";
import { Route, Routes } from "react-router-dom";
import { connect } from "react-redux";
import { compose } from "redux";
import {initializedApp} from "./reduser/app-reduser.js"
import Login from "./Component/LoginForm/LoginForm.jsx";
import Register from "./Component/RegisterForm/RegisterForm.jsx";
import withSuspense from "./hoc/withSuspence";

const HeaderContainer = React.lazy(() => import('./Component/Header/HeaderContainer.jsx'))

class App extends React.Component {
  componentDidMount() {
    this.props.initializedApp();
  }

  render() {
    return (
      <div>
        {withSuspense(HeaderContainer)}
        {/* {withSuspense(NavbarContainer)} */}
        <Routes>
          {/* <Route
            path="/profile/:userId?"
            element={withSuspense(ProfileComponent)}
          /> */}
          {/* <Route path="/dialogs/" element={withSuspense(DialogsContainer)} /> */}
          {/* <Route path="/dialogs/:id" element={withSuspense(DialogsContainer)} /> */}
          {/* <Route path="/news" element={withSuspense(NewsContainer)} /> */}
          {/* <Route path="/music" element={withSuspense(MusicContainer)} /> */}
          {/* <Route path="/settings" element={<Settings />} /> */}
          {/* <Route path="/users" element={withSuspense(UsersContainer)} /> */}
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          {/* <Route path="/friends" element={withSuspense(FriendsContainer)} /> */}
        </Routes>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  initialized: state.app.initialized,
});

export default compose(connect(mapStateToProps, { initializedApp }))(App);
